    export function getVendors() {
        const vendors = cpes.map( (cpe) => {
            return cpe.id.split(':')[3];
        })
        return vendors;
    }
    
    export function getProducts() {
        const products = cpes.map( (cpe) => {
            return cpe.id.split(':')[4];
        })
        return products;
    }
    
    export function getAutoComplete(toComplete) {
        const vendors = getVendors();
        //const products = getProducts();
        const result = vendors.forEach((vendor) => {
            if (vendor.startsWith(toComplete)) {
                return vendor;
            }
        });
        return result;
    }
    
    export function getSelectedCves() {
        return cves;
    }
    
    export function getSelectedCpes() {
        return cpes;
    }